url': 'https://api.github.com/users/odrotbohm/received_events', 'type': 'User', 'site_admin': False}], 'milestone': None, 'comments': 1, 'created_at': '2015-05-29T07:41:08Z', 'updated_at': '2022-04-21T15:22:48Z', 'closed_at': '2022-04-21T15:22:47Z', 'author_association': 'NONE', 'active_lock_reason': None, 'body': '**[Guillaume Rosauro](https://jira.spring.io/secure/ViewProfile.jspa?name=willome)** opened **[DATAJPA-729](https://jira.spring.io/browse/DATAJPA-729?redirect=false)** and commented

Unnecessary outer joins are generated when a single table is queried for counting. It could be a duplicate of : https://jira.spring.io/browse/DATAJPA-401

```java
@Entity
public class BankAccountControl {
    @Id
    private long id;

    @ManyToOne
    @JoinColumn(name ="uac_id", nullable = false)
    private UserAccount userAccount;

    // setter/getters are here
}

@Entity
public class UserAccount {

    @Id
    @Column(name = "uac_id")
    private long id;
    private String firstname;
    private String lastname;

    // setter/getters are here
}
```

SQL generated with spring-data-jpa :

```java
public Long countByUserAccount_id(Long id);

select
        count(bankaccoun0_.COB_ID) as col_0_0_ 
    from
        USR_CONTROL_BANK_ACCOUNT bankaccoun0_ 
    left outer join
        USR_USER_ACCOUNT useraccoun1_ 
            on bankaccoun0_.UAC_ID=useraccoun1_.UAC_ID 
    where
        useraccoun1_.UAC_ID=?

```

SQL generated with jpql :

```java
@Query(value = "select count(bac) from BankAccountControl bac where bac.userAccount.id = ?1")
public Long countUserAccounts(Long id);

 select
        count(bankaccoun0_.COB_ID) as col_0_0_ 
    from
        USR_CONTROL_BANK_ACCOUNT bankaccoun0_ 
    where
        bankaccoun0_.UAC_ID=?

```



---

**Affects:** 1.7.2 (Evans SR2), 1.8 GA (Fowler)
