2. This issue is hinting that when you write a `countBy` operation and you explicitly go through a relationship, that Spring Data JPA should optimize the query and remove unnecessary joins. I'm not quite sure Spring Data JPA can do such an optimization. Of if its even necessary.

First of all, if you're concerned about it being a LEFT OUTER JOIN, that's merely a byproduct of `@ManyToOne` not having its `optional` parameter set to false. Because it COULD be `null`, we have to use a LEFT OUTER JOIN. If you can assert that in all situations, the field will be populated, you can adjust the entity's definition to say so.

Second, the example provided either joins on `bankaccoun0_` foreign key into `useraccoun1_` and then applies the WHERE to `useraccoun1_`'s primary key. Or in your hand-edited example, it simply matches on `bankaccoun0_` foreign key directly. These queries are semantically equivalent. The foreign key in `bankaccount0_` IS the primary key in `useraccoun1_`. Thus, no extra rows will be brought in nor will any appropriate rows be left out in either situation.

Another question could be about performance. If the database's primary keys are properly indexed (as they should be), then the Spring Data-generated query's WHERE portion should be hitting an index. And the JOIN should also be hitting the same index. So I see little risk in a performance issue. It should quickly find the proper row and not end up generating some huge cartesian product nor risking a full table scan due to do an upper.

Therefore, I don't think there is anything to pursue here. Again, if a query isn't fully optimized, is too complex for Spring Data's query derivation, and appears to be a performance concern, then yes you can fall back to `@Query`. But in this situation I don't see anything to fix.", 'reactions': {'url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/issues/comments/1105373929/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

