ons_url': 'https://api.github.com/users/schauder/subscriptions', 'organizations_url': 'https://api.github.com/users/schauder/orgs', 'repos_url': 'https://api.github.com/users/schauder/repos', 'events_url': 'https://api.github.com/users/schauder/events{/privacy}', 'received_events_url': 'https://api.github.com/users/schauder/received_events', 'type': 'User', 'site_admin': False}], 'milestone': None, 'comments': 6, 'created_at': '2018-03-21T21:46:35Z', 'updated_at': '2022-04-19T17:40:11Z', 'closed_at': '2022-04-19T17:40:11Z', 'author_association': 'NONE', 'active_lock_reason': None, 'body': '**[Sergei Poznanski](https://jira.spring.io/secure/ViewProfile.jspa?name=cepr0)** opened **[DATAJPA-1299](https://jira.spring.io/browse/DATAJPA-1299?redirect=false)** and commented

Repository query methods with 'join fetch' leads to the duplicate parents.
Number of duplicates corresponds to the number of nested children.

To work around this situation we can use 'distinct' in the query. But this still does not work with projections.

The similar methods with `@EntityGraph` work as expected.

Example:

```java
@Entity
class Parent extends BaseEntity {
	private String name;
	@OneToMany(mappedBy = "parent")
	private List<Child> children;
}

@Entity
class Child extends BaseEntity {
	private String name;
	@ManyToOne(fetch = LAZY)
	private Parent parent;
}

interface ParentProjection {
	Integer getId();
	String getName();
	List<Child> getChildren();
}

interface ParentRepo extends JpaRepository<Parent, Integer> {

	@EntityGraph(attributePaths = "children")
	@Override
	List<Parent> findAll(); // works as expected 

	@Query("select p from Parent p left join fetch p.children")
	List<Parent> findWithQuery(); // has duplicated parents
	
	@Query("select distinct p from Parent p left join fetch p.children")
   	List<Parent> findDistinctWithQuery(); // does not have duplicated parents
	
	@EntityGraph(attributePaths = "children")
	List<ParentProjection> findProjectionsBy(); // works as expected
		
	@Query("select distinct p from Parent p left join fetch p.children")
   	List<ParentProjection> findDistinctProjectionsWithQuery(); // has duplicated parents 
}
```

More tests is [here](https://github.com/Cepr0/duplicate-parent-entities/blob/master/src/test/java/io/github/cepr0/demo/repo/ParentRepoTest.java)


