015, 'node_id': 'MDQ6VXNlcjEwMzUwMTU=', 'avatar_url': 'https://avatars.githubusercontent.com/u/1035015?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/mp911de', 'html_url': 'https://github.com/mp911de', 'followers_url': 'https://api.github.com/users/mp911de/followers', 'following_url': 'https://api.github.com/users/mp911de/following{/other_user}', 'gists_url': 'https://api.github.com/users/mp911de/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/mp911de/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/mp911de/subscriptions', 'organizations_url': 'https://api.github.com/users/mp911de/orgs', 'repos_url': 'https://api.github.com/users/mp911de/repos', 'events_url': 'https://api.github.com/users/mp911de/events{/privacy}', 'received_events_url': 'https://api.github.com/users/mp911de/received_events', 'type': 'User', 'site_admin': False}, 'assignees': [{'login': 'mp911de', 'id': 1035015, 'node_id': 'MDQ6VXNlcjEwMzUwMTU=', 'avatar_url': 'https://avatars.githubusercontent.com/u/1035015?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/mp911de', 'html_url': 'https://github.com/mp911de', 'followers_url': 'https://api.github.com/users/mp911de/followers', 'following_url': 'https://api.github.com/users/mp911de/following{/other_user}', 'gists_url': 'https://api.github.com/users/mp911de/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/mp911de/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/mp911de/subscriptions', 'organizations_url': 'https://api.github.com/users/mp911de/orgs', 'repos_url': 'https://api.github.com/users/mp911de/repos', 'events_url': 'https://api.github.com/users/mp911de/events{/privacy}', 'received_events_url': 'https://api.github.com/users/mp911de/received_events', 'type': 'User', 'site_admin': False}], 'milestone': None, 'comments': 4, 'created_at': '2021-11-22T18:07:54Z', 'updated_at': '2022-04-18T18:47:15Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': "There appears to be no clean way to use a custom QueryDSL `JPQLTemplates` class when creating a query: `Querydsl#createQuery` is hardcoded to use either `EclipseLinkTemplates`, `HQLTemplates` or the default. It'd be great if the template could be customized there, or the method easily overridden.

**Use case**

We need to emit SQL that calls the unaccent Postgres function when using `StringExpression::startsWithIgnoreCase`. The customized template achieves that by overriding `Ops.STARTS_WITH_IC`. This is then usable in a custom repository implementation by injecting the `EntityManager` and creating a new JPAQuery: `new JPAQuery<>(entityManager, new SomeOverridenTemplate())` -- but when using `QuerydslJpaPredicateExecutor` the `JPAQuery` is generated within spring-data-jpa itself.
