```java
	interface QueryDslSampleRepository extends JpaRepository<User, Integer>, QuerydslPredicateExecutor<User> {

		User findByFirstname(String name);

	}

	class CustomQuerydslJpaPredicateExecutor<T> extends QuerydslJpaPredicateExecutor<T> {

		public CustomQuerydslJpaPredicateExecutor(JpaEntityInformation<T, ?> entityInformation, EntityManager entityManager,
				EntityPathResolver resolver, CrudMethodMetadata metadata) {
			super(entityInformation, entityManager, resolver, metadata);
		}

	}

	class CustomFragmentJpaRepositoryFactory extends JpaRepositoryFactory {

		public CustomFragmentJpaRepositoryFactory(EntityManager entityManager) {
			super(entityManager);
		}

		@Override
		protected RepositoryFragments getRepositoryFragments(RepositoryMetadata metadata, EntityManager entityManager,
				EntityPathResolver resolver, CrudMethodMetadata crudMethodMetadata) {

			JpaEntityInformation<?, Serializable> entityInformation = getEntityInformation(metadata.getDomainType());

			RepositoryFragment customFragment = RepositoryFragment.implemented(new CustomQuerydslJpaPredicateExecutor<>(
					getEntityInformation(metadata.getDomainType()), entityManager, resolver, crudMethodMetadata));

			return RepositoryFragments.of(customFragment);
		}
	}

	class CustomFragmentJpaRepositoryFactoryBean<T extends Repository<S, ID>, S, ID>
			extends JpaRepositoryFactoryBean<T, S, ID> {

		public CustomFragmentJpaRepositoryFactoryBean(Class<? extends T> repositoryInterface) {
			super(repositoryInterface);
		}

		@Override
		protected RepositoryFactorySupport createRepositoryFactory(EntityManager entityManager) {
			return new CustomFragmentJpaRepositoryFactory(entityManager);
		}
	}

	@Configuration
	@ImportResource("classpath:infrastructure.xml")
	@EnableJpaRepositories(repositoryFactoryBeanClass = CustomFragmentJpaRepositoryFactoryBean.class)
	static class Config {}
```

That may be a bit hefty, but it DOES gives you the ability to plugin in your own implementation of `QuerydslPredicateExecutor`, giving you control over how Querydsl works for you.

