```java
ExtendWith(SpringExtension.class)
@ContextConfiguration(classes = SampleConfig.class)
@Transactional
public class RepositoryWithCompositeScalarKeyTests {

	@Autowired SecurityRateRepository repository;

	@Test
	void storingCompositeKeyWithScalarLongWorks() {

		SecurityRate securityRate1 = new SecurityRate("customer-1");
		SecurityRate securityRate2 = new SecurityRate("customer-2");

		repository.saveAllAndFlush(List.of(securityRate1, securityRate2));

		List<SecurityRate> securityRates = repository.findAll();
		assertThat(securityRates).hasSize(2);
		assertThat(securityRates.get(0).getId()).isEqualTo(1L);
		assertThat(securityRates.get(0).getCustomerId()).isEqualTo("customer-1");
		assertThat(securityRates.get(1).getId()).isEqualTo(2L);
		assertThat(securityRates.get(1).getCustomerId()).isEqualTo("customer-2");
	}
}
```

