It appears that EclipseLink, if it sees a `null` in a `CriteriaQuery.where()` clause, will simply clear out the `where` clause. No harm there.

But Hibernate 5.5 and 5.6 appear to try and figure out the type of the clause, and since the type safety of this being a `Predicate` appears to get lost along the way, will seemingly wrap it in a faulty type.

```java
  public Predicate wrap(Expression<Boolean> expression) {
    if (Predicate.class.isInstance(expression)) {
      return (Predicate)expression;
    } else {
      return (Predicate)(PathImplementor.class.isInstance(expression) ? new BooleanAssertionPredicate(this, expression, Boolean.TRUE) : new BooleanExpressionPredicate(this, expression));
    }
  }
```

Our `Specification` and `SpecificationComposition` appear to nicely handle `Predicate` being a `null`, as does `SimpleJpaRepository` when applying a `Specification` to fashion a query. I'm a little fuzzy on if this is adequate coverage for what we use it for, and ample warning for end users.
