8-26T07:02:36Z', 'updated_at': '2022-04-11T17:36:31Z', 'closed_at': '2022-04-11T17:36:31Z', 'author_association': 'NONE', 'active_lock_reason': None, 'body': 'Hi,I use a customized attributeConverter Convert List to String.The converter code is：
```java
public class ListConverter implements AttributeConverter<List<String>,String> {

    final private String splitTag = ",";

    @Override
    public String convertToDatabaseColumn(List<String> list) {
        String baseColumn = "";
        if (list.isEmpty()){
            return baseColumn;
        }
        baseColumn = list.stream().collect(Collectors.joining(","));
        return baseColumn;
    }

    @Override
    public List<String> convertToEntityAttribute(String s) {
        List<String> list = Lists.newArrayList();
        if (StringUtils.isEmpty(s)){
            return list;
        }
        String[] split = s.split(splitTag);
        for (int i = 0; i < split.length; i++) {
            list.add(split[i]);
        }
        return list;
    }

}
```
I use it on attributes :
```java
    @Convert(converter = ListConverter.class)
    @Column(columnDefinition = "TEXT")
    private List<String> requestPatterns;
```
when I use this attributes to query the entity list .
```java
   repo.findAll(Example.of(Domain.builder().requestPatterns(Lists.newArrayList("222","333")).build()));
```
The program reported an error said:
```
org.springframework.dao.InvalidDataAccessApiUsageException: Parameter value [222] did not match expected type [java.util.List (n/a)]; nested exception is java.lang.IllegalArgumentException:
```
when I debug the code,I found a method  QueryParameterBindingsImpl.expandListValuedParameters(@Deprecated,syntheticBinding.setBindValue(bindValue)) to compare the type of each element in the List with the type of attribute . I user the version 2.1.6.RELEASE. I want to know how to do it without update version. thanks.', 'reactions': {'url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/issues/2286/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/issues/2286/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/issues/comments/1095339713', 'html_url': 'https://github.com/spring-projects/spring-data-jpa/issues/2286#issuecomment-1095339713', 'issue_url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/issues/2286', 'id': 1095339713, 'node_id': 'IC_kwDOABBezc5BSY7B', 'user': {'login': 'gregturn', 'id': 311040, 'node_id': 'MDQ6VXNlcjMxMTA0MA==', 'avatar_url': 'https://avatars.githubusercontent.com/u/311040?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/gregturn', 'html_url': 'https://github.com/gregturn', 'followers_url': 'https://api.github.com/users/gregturn/followers', 'following_url': 'https://api.github.com/users/gregturn/following{/other_user}', 'gists_url': 'https://api.github.com/users/gregturn/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/gregturn/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/gregturn/subscriptions', 'organizations_url': 'https://api.github.com/users/gregturn/orgs', 'repos_url': 'https://api.github.com/users/gregturn/repos', 'events_url': 'https://api.github.com/users/gregturn/events{/privacy}', 'received_events_url': 'https://api.github.com/users/gregturn/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-04-11T17:36:31Z', 'updated_at': '2022-04-11T17:36:31Z', 'author_association': 'MEMBER', 'body': 'Per [JPA 2.2 section 3.8](https://download.oracle.com/otn-pub/jcp/persistence-2_2-mrel-spec/JavaPersistence.pdf) (p. 122), Attribute Converters are meant for "basic types" 

> Converters can be used to convert basic attributes defined by entity classes, mapped superclasses, or embeddable classes.

Attempting to convert a container (`List`) back and forth runs into who knows how many issues. This issue could also surface were you to try this with other "containers" types of generic nature (Optional, Map, who knows).

You should consider either storing the list directly in the table, looking up how to do that properly with JPA. Or consider crafting a more complete type that captures this concept. I've seen examples online that show things like `PersonName` converted to a `VARCHAR` and back. Nothing generic in there or container-ish to confuse JPA or Hibernate.', 'reactions': {'url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/issues/comments/1095339713/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

