': 'https://api.github.com/repos/spring-projects/spring-data-jpa/labels/type:%20enhancement', 'name': 'type: enhancement', 'color': 'e3d9fc', 'default': False, 'description': 'A general enhancement'}, {'id': 2509571145, 'node_id': 'MDU6TGFiZWwyNTA5NTcxMTQ1', 'url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/labels/in:%20query-parser', 'name': 'in: query-parser', 'color': 'e8f9de', 'default': False, 'description': 'Everything related to parsing JPQL or SQL'}], 'state': 'open', 'locked': False, 'assignee': {'login': 'gregturn', 'id': 311040, 'node_id': 'MDQ6VXNlcjMxMTA0MA==', 'avatar_url': 'https://avatars.githubusercontent.com/u/311040?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/gregturn', 'html_url': 'https://github.com/gregturn', 'followers_url': 'https://api.github.com/users/gregturn/followers', 'following_url': 'https://api.github.com/users/gregturn/following{/other_user}', 'gists_url': 'https://api.github.com/users/gregturn/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/gregturn/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/gregturn/subscriptions', 'organizations_url': 'https://api.github.com/users/gregturn/orgs', 'repos_url': 'https://api.github.com/users/gregturn/repos', 'events_url': 'https://api.github.com/users/gregturn/events{/privacy}', 'received_events_url': 'https://api.github.com/users/gregturn/received_events', 'type': 'User', 'site_admin': False}, 'assignees': [{'login': 'gregturn', 'id': 311040, 'node_id': 'MDQ6VXNlcjMxMTA0MA==', 'avatar_url': 'https://avatars.githubusercontent.com/u/311040?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/gregturn', 'html_url': 'https://github.com/gregturn', 'followers_url': 'https://api.github.com/users/gregturn/followers', 'following_url': 'https://api.github.com/users/gregturn/following{/other_user}', 'gists_url': 'https://api.github.com/users/gregturn/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/gregturn/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/gregturn/subscriptions', 'organizations_url': 'https://api.github.com/users/gregturn/orgs', 'repos_url': 'https://api.github.com/users/gregturn/repos', 'events_url': 'https://api.github.com/users/gregturn/events{/privacy}', 'received_events_url': 'https://api.github.com/users/gregturn/received_events', 'type': 'User', 'site_admin': False}], 'milestone': None, 'comments': 4, 'created_at': '2021-02-25T09:44:30Z', 'updated_at': '2022-04-06T14:04:21Z', 'closed_at': None, 'author_association': 'MEMBER', 'active_lock_reason': None, 'body': 'Right now, we face [several tickets](https://github.com/spring-projects/spring-data-jpa/labels/in%3A%20query-parser) where we run into issues when trying to rewrite a query to append `ORDER BY` fields and pagination. 

The initial idea of providing a query parser introduces a lot of complexity to parse JPQL queries and more complexity when parsing native SQL queries as we are not in full control of each dialect nor it makes sense to have a full parser that considers the complete SQL specification.

To address the mentioned issues (see #2079, #2045, #1895, and others), we should investigate whether we can provide a callback API where the calling code can handle the actual rewrite. Calling a `@Query` annotated method accepting either `Sort` or `Pageable` arguments, we would activate the query rewrite callback for rewriting the query. The code path utilizing `QueryUtils` would be entirely skipped so that the rewrite responsibility is within the calling code.

As starting point, we could have a `@QueryRewrite` annotation accepting a Java class that implements the callback API, something along the lines of:

```java
@FunctionalInterface
interface QueryRewriter {
    String rewrite(String query, Sort sort);

    default rewrite(String query, Pageable pageable) {
        return rewrite(query, pageRequest.getSort());
    }
}
```

to be used as:

```java
interface MyRepository extends CrudRepository<Foo, String> {
    @Query(…, nativeQuery = true)
    @QueryRewrite(MyQueryRewriter.class)
    List<Foo> myFindAllMethod(Pageable pageable);
}
```


Following that idea, one could also write:

```java
interface MyRepository extends CrudRepository<Foo, String>, QueryRewriter {
    @Query(…, nativeQuery = true)
    @QueryRewrite(QueryRewrite.Repository.class)
    List<Foo> myFindAllMethod(Pageable pageable);

    default String rewrite(String query, Sort sort) {
        return …;
    } 
}
```

where `QueryRewrite.Repository.class` can be a marker to indicate that the actual repository interface contains the actual method implementation.', 'reactions': {'url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/issues/2162/reactions', 'total_count': 3, '+1': 3, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/issues/2162/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/issues/comments/1090312562', 'html_url': 'https://github.com/spring-projects/spring-data-jpa/issues/2162#issuecomment-1090312562', 'issue_url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/issues/2162', 'id': 1090312562, 'node_id': 'IC_kwDOABBezc5A_Nly', 'user': {'login': 'gregturn', 'id': 311040, 'node_id': 'MDQ6VXNlcjMxMTA0MA==', 'avatar_url': 'https://avatars.githubusercontent.com/u/311040?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/gregturn', 'html_url': 'https://github.com/gregturn', 'followers_url': 'https://api.github.com/users/gregturn/followers', 'following_url': 'https://api.github.com/users/gregturn/following{/other_user}', 'gists_url': 'https://api.github.com/users/gregturn/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/gregturn/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/gregturn/subscriptions', 'organizations_url': 'https://api.github.com/users/gregturn/orgs', 'repos_url': 'https://api.github.com/users/gregturn/repos', 'events_url': 'https://api.github.com/users/gregturn/events{/privacy}', 'received_events_url': 'https://api.github.com/users/gregturn/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-04-06T14:04:21Z', 'updated_at': '2022-04-06T14:04:21Z', 'author_association': 'MEMBER', 'body': '> Reusing the rewriter for multiple query methods seems hard because implementations will have to guess the actual method executed by inspecting the query to get context.

For the record, this is simply an artifact of test method simplification. In production, I'd be VERY resistant to reusing a QueryRewriter, but instead prefer a custom one for every method.

> The general instantiation mechanism should leverage BeanFactory.getBean(…)/AutowireCapableBeanFactory.createBean(…)/BeanUtils.instantiate(…)

To get the BeanFactory down into the class hierarchy where the QueryRewriter is created seemed a bit invasive. I can tinker with it more.

> Getting the String query passed in basically means having to parse it at least partially. Even in our experience, augmenting the JPQL query strings has been a source of problems, and I wonder if putting that into users hands is just creating a different problem than just writing fragments to implement those queries manually.

Maybe I don't follow. I thought the purpose of this proposal was to offer a last-minute escape where the user can tweak the finalized query at the last minute. So instead of adding more fragments and "things", we could instead do all the parsing needed, and then use a QueryRewriter right before the SQL goes to the entityManager.', 'reactions': {'url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/issues/comments/1090312562/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

