turn/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/gregturn/subscriptions', 'organizations_url': 'https://api.github.com/users/gregturn/orgs', 'repos_url': 'https://api.github.com/users/gregturn/repos', 'events_url': 'https://api.github.com/users/gregturn/events{/privacy}', 'received_events_url': 'https://api.github.com/users/gregturn/received_events', 'type': 'User', 'site_admin': False}], 'milestone': None, 'comments': 0, 'created_at': '2021-02-25T09:44:30Z', 'updated_at': '2022-04-05T20:55:41Z', 'closed_at': None, 'author_association': 'MEMBER', 'active_lock_reason': None, 'body': 'Right now, we face [several tickets](https://github.com/spring-projects/spring-data-jpa/labels/in%3A%20query-parser) where we run into issues when trying to rewrite a query to append `ORDER BY` fields and pagination. 

The initial idea of providing a query parser introduces a lot of complexity to parse JPQL queries and more complexity when parsing native SQL queries as we are not in full control of each dialect nor it makes sense to have a full parser that considers the complete SQL specification.

To address the mentioned issues (see #2079, #2045, #1895, and others), we should investigate whether we can provide a callback API where the calling code can handle the actual rewrite. Calling a `@Query` annotated method accepting either `Sort` or `Pageable` arguments, we would activate the query rewrite callback for rewriting the query. The code path utilizing `QueryUtils` would be entirely skipped so that the rewrite responsibility is within the calling code.

As starting point, we could have a `@QueryRewrite` annotation accepting a Java class that implements the callback API, something along the lines of:

```java
@FunctionalInterface
interface QueryRewriter {
    String rewrite(String query, Sort sort);

    default rewrite(String query, Pageable pageable) {
        return rewrite(query, pageRequest.getSort());
    }
}
```

to be used as:

```java
interface MyRepository extends CrudRepository<Foo, String> {
    @Query(…, nativeQuery = true)
    @QueryRewrite(MyQueryRewriter.class)
    List<Foo> myFindAllMethod(Pageable pageable);
}
```


Following that idea, one could also write:

```java
interface MyRepository extends CrudRepository<Foo, String>, QueryRewriter {
    @Query(…, nativeQuery = true)
    @QueryRewrite(QueryRewrite.Repository.class)
    List<Foo> myFindAllMethod(Pageable pageable);

    default String rewrite(String query, Sort sort) {
        return …;
    } 
}
```

where `QueryRewrite.Repository.class` can be a marker to indicate that the actual repository interface contains the actual method implementation.', 'reactions': {'url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/issues/2162/reactions', 'total_count': 3, '+1': 3, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/issues/2162/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/issues/comments/1089336369', 'html_url': 'https://github.com/spring-projects/spring-data-jpa/issues/2162#issuecomment-1089336369', 'issue_url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/issues/2162', 'id': 1089336369, 'node_id': 'IC_kwDOABBezc5A7fQx', 'user': {'login': 'gregturn', 'id': 311040, 'node_id': 'MDQ6VXNlcjMxMTA0MA==', 'avatar_url': 'https://avatars.githubusercontent.com/u/311040?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/gregturn', 'html_url': 'https://github.com/gregturn', 'followers_url': 'https://api.github.com/users/gregturn/followers', 'following_url': 'https://api.github.com/users/gregturn/following{/other_user}', 'gists_url': 'https://api.github.com/users/gregturn/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/gregturn/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/gregturn/subscriptions', 'organizations_url': 'https://api.github.com/users/gregturn/orgs', 'repos_url': 'https://api.github.com/users/gregturn/repos', 'events_url': 'https://api.github.com/users/gregturn/events{/privacy}', 'received_events_url': 'https://api.github.com/users/gregturn/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-04-05T20:55:41Z', 'updated_at': '2022-04-05T20:55:41Z', 'author_association': 'MEMBER', 'body': '@mp911de,

My current implementation can handle:

```java
public interface UserRepository extends Repository<User, Integer> {

	@Query(value = "select u.* from User u", nativeQuery = true)
	@QueryRewrite(TestQueryRewriter.class)
	List<User> findByNativeQuery(String param);

	@Query(value = "select u.* from User u")
	@QueryRewrite(TestQueryRewriter.class)
	List<User> findByNonNativeQuery(String param);

	@Query(value = "select u.* from User u")
	@QueryRewrite(TestQueryRewriter.class)
	List<User> findByNonNativeSortedQuery(String param, Sort sort);

	@Query(value = "select u.* from User u")
	@QueryRewrite(TestQueryRewriter.class)
	List<User> findByNonNativePagedQuery(String param, Pageable pageable);
}
```

```java
static class TestQueryRewriter implements QueryRewriter {
	@Override
	public String rewrite(String query, Sort sort) {
		return query.replaceAll("u", "user");
	}
}
```

It supports native/standard, sort params, and pageable params. Because of the way it works, there is no easy way to grab a hold of an existing repository and inject it into the code that generates the SQL statements. So I really don't see a way to do that extension where the repository is ALSO the rewriter.

Basically, `JpaQueryFactory` appears to be the hook for all query creation, and it doesn't have access to repository beans. Down the road, if we figured out how to get it access, that might be possible. But right now, I have implemented it where the `AbstractStringJpaQuery` class uses this to transform `@QueryRewrite(TestQueryRewriter.class)` into an instance...

```java
@Nullable
protected QueryRewriter findQueryRewriter(JpaQueryMethod method) {

	Class<? extends QueryRewriter> queryRewriter = method.getQueryRewriter();

	if (queryRewriter == null) {
		return null;
	}

	try {
		return (QueryRewriter) ((Constructor<?>) queryRewriter.getDeclaredConstructor()).newInstance();
	} catch (InstantiationException | IllegalAccessException | InvocationTargetException | NoSuchMethodException e) {
		System.out.println(e);
		return null;
	}
}
```

