{'action': 'closed', 'number': 2377, 'pull_request': {'url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/pulls/2377', 'id': 795090717, 'node_id': 'PR_kwDOABBezc4vZB8d', 'html_url': 'https://github.com/spring-projects/spring-data-jpa/pull/2377', 'diff_url': 'https://github.com/spring-projects/spring-data-jpa/pull/2377.diff', 'patch_url': 'https://github.com/spring-projects/spring-data-jpa/pull/2377.patch', 'issue_url': 'https://api.github.com/repos/spring-projects/spring-data-jpa/issues/2377', 'number': 2377, 'state': 'closed', 'locked': False, 'title': '`@Query` supports query derivation from substitute.', 'user': {'login': 'DiegoKrupitza', 'id': 25965672, 'node_id': 'MDQ6VXNlcjI1OTY1Njcy', 'avatar_url': 'https://avatars.githubusercontent.com/u/25965672?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/DiegoKrupitza', 'html_url': 'https://github.com/DiegoKrupitza', 'followers_url': 'https://api.github.com/users/DiegoKrupitza/followers', 'following_url': 'https://api.github.com/users/DiegoKrupitza/following{/other_user}', 'gists_url': 'https://api.github.com/users/DiegoKrupitza/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/DiegoKrupitza/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/DiegoKrupitza/subscriptions', 'organizations_url': 'https://api.github.com/users/DiegoKrupitza/orgs', 'repos_url': 'https://api.github.com/users/DiegoKrupitza/repos', 'events_url': 'https://api.github.com/users/DiegoKrupitza/events{/privacy}', 'received_events_url': 'https://api.github.com/users/DiegoKrupitza/received_events', 'type': 'User', 'site_admin': False}, 'body': 'Method names for derived queries can become quite long if a property of the class has a long name, even though the logic behind the query is trivial. For such simple queries we now can provide the long and maybe ugly name as a substitute via the `@Query` annotation and have a more pleasant/short and useable method name. The `PartTreeJpaQuery` will use the substitute to derive the query.

Example Use case:

`Course.java`
```java
class Course {
   private LocalDateTime preferenceSubDeadline;
   private LocalDateTime teamSubDeadline;
   //...
}
```

`CourseRepositoryWithLongName.java`
```java
@Repository
public interface CourseRepositoryWithLongName
    extends PagingAndSortingRepository<Course, Long> {

    List<Course> findAllByPreferenceSubDeadlineBeforeAndTeamSubDeadlineAfter(LocalDateTime pref, LocalDateTime team);

}
```

The super long but actually trivial method to find all courses with preference deadline before X and team deadline after Y inside `CourseRepositoryWithLongName` could be simplified by using the now introduced "substitute" way.

`CourseRepositoryWithSubstitute.java`
```java
@Repository
public interface CourseRepositoryWithSubstitute
    extends PagingAndSortingRepository<Course, Long> {

    @Query(substitute = "findAllByPreferenceSubDeadlineBeforeAndTeamSubDeadlineAfter")
    List<Course> inbetweenPrefAndTeamDeadline(LocalDateTime pref, LocalDateTime team);

}
```

As you can see the `CourseRepositoryWithSubstitute` is now cleaner and still does not required the programmer to write a custom query. 

I often encountered the case that the method name became quite long although the idea behind the method is trivial. I always thought writing a query by hand would be too much, since for most trivial cases the derived query is more convenient.


