.com/users/gregturn/events{/privacy}', 'received_events_url': 'https://api.github.com/users/gregturn/received_events', 'type': 'User', 'site_admin': False}], 'milestone': None, 'comments': 4, 'created_at': '2021-11-25T22:40:59Z', 'updated_at': '2022-03-22T19:35:18Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': "i see that an Entity with `@CreatedDate` and `@LastModifiedDate` and other auditable annotations works nice when those attributes are in the same class annotated with @Entity, but it doesn't seem to work when those are on a `@Embeddable` annotated class

```java
@Embeddable
public class Auditable {

    @CreatedDate
    private Instant cratedDate;

    @LastModifiedDate
    private Instant lastModifiedDate;
     ...
}
```

```java
@Entity
@EntityListeners(AuditableListener.class) //this works with embedded, it is a custom Auditable
//@EntityListeners(AuditingEntityListener.class) //doesn't work for embedded
public class EntityB implements AuditableEntity{

    @Id
    @GeneratedValue
    private UUID uuid;

    private String randomAtt;

    @Embedded
    private AuditablePart auditablePart;

    ...
```

it would be cool if it can be used a similar approach by using the same `AuditingEntityListener.class` in addition to a custom one

i made a [demo project](https://github.com/dgallego58/demo-auditable) showing this

